import React, { useState, useEffect } from 'react';
import './Video.css';

const VideoComponent = () => {
  const [showFirstSvg, setShowFirstSvg] = useState(false);
  const [showSecondSvg, setShowSecondSvg] = useState(false);

  useEffect(() => {
    const timer1 = setTimeout(() => {
      setShowFirstSvg(true);
    }, 5000);

    const timer2 = setTimeout(() => {
      setShowSecondSvg(true);
    }, 5500);

    return () => {
      clearTimeout(timer1);
      clearTimeout(timer2);
    };
  }, []);

  return (
    <div className="video-container">
      <video autoPlay loop muted className="background-video">
        <source src="video.mp4" type="video/mp4" />
      </video>
      {showFirstSvg && (
        <img src="first-text.svg" className="overlay-svg first-svg" alt="First SVG" />
      )}
      {showSecondSvg && (
        <img src="second-text.svg" className="overlay-svg second-svg" alt="Second SVG" />
      )}
    </div>
  );
};

export default VideoComponent;
